import React from 'react';
import './ItemCard.css';

function ItemCard({ text, onDelete }) {
  return (
    <div className="item-card">
      <p>{text}</p>
      <button onClick={onDelete}>Delete</button>
    </div>
  );
}

export default ItemCard;
